const height = 600 - 2 * margin

const svg = d3.select('.barchart')

const chart = svg
  .append('g')
  .attr('transform', `translate(${margin}, ${margin})`)

const yScale = d3
  .scaleLinear()
  .range([height, 0])
  .domain([0, languagesCount[0].value + 10])

chart.append('g').call(d3.axisLeft(yScale))

const xScale = d3
